import React  from "react";
import './style.css'
const HeadName = () => {
    return(
        <>
            <div >
                <h1 style={{textAlign : "center"}}>To Do List</h1>
                <button type="button" class="btn btn-primary">Primary</button>

            </div>
        </>
    )
    } 
export default HeadName;
